import Landing from './Landing';
import Nav from './Nav';
import About from './About';
import Experience from './Experience';
import Contact from './Contact';

import './Main.css';

function Main() {
  return (
    <div className='main'>
        <Landing/>
        <Nav/>
        <About/>
        <Experience/>
        <Contact/>
        <button>UP</button>
    </div>
  );
}

export default Main;
